    - ID: "30b0a514-dc94-432c-9655-8c01e474023f"
      Hint: ExtendedContent
      Value: |
        <p>Featuring 3-in-1 insect control with an adulticide, a synergist and an insect growth regulator (IGR), Inselux&trade; Fog &amp; Mill Spray kills exposed insects and breaks the insect&rsquo;s life cycle for long-term control. This innovative product provides broad-spectrum control of weevils, saw-toothed grain beetles, Indian meal moths and other listed stored grain insects.
        </p>
        <ul>
            <li>Combination insect growth regulator, synergist and adulticide
            </li>
            <li>Three active ingredients: (S)-methoprene, Pyrethrins, Piperonyl Butoxide
            </li>
            <li>IGR reduces rebound of infestations
            </li>
            <li>May be diluted, or used undiluted
            </li>
            <li>Flushing action for improved efficacy
            </li>
            <li>For use with mechanical thermal or compressed air fogging systems or space spray</li>
        </ul>
